/** 
 * Writes a new line to the file, if it doesn't exist it will automatically create it.
 * @param filename
 * @param fileContents
 * @param debug
 */
public static synchronized void writeNewLine(String filename,byte[] fileContents,boolean debug){
  new File(filename).getParentFile().mkdirs();
  PrintWriter writer=null;
  String original=filename;
  int counter=0;
  boolean saved=false;
  int failSafe=0;
  while (!saved && failSafe++ <= 42069) {
    try {
      writer=new PrintWriter(new BufferedWriter(new FileWriter(filename,true)));
      writer.println(Arrays.toString(fileContents));
      if (debug)       System.out.println("Saved " + filename + " to disk");
      saved=true;
    }
 catch (    Exception e) {
      if (debug)       System.out.println("Failed saving, trying to save as " + filename);
      if (original.contains(".")) {
        filename=insertFileName(original,"" + counter);
      }
 else       filename=original + counter;
      counter++;
    }
  }
  writer.close();
}
